import { LoadingOutlined, SyncOutlined } from '@ant-design/icons';
import { Button } from 'antd';
import React from 'react'
import { btnBackgroundColor, btnTextColor } from '../uiConfig'; 

export default function ButtonPrimary(props) {
  const { text, onClick, disabledCondition } = props;
  return (
    <Button disabled={disabledCondition} style={{backgroundColor: btnBackgroundColor, color: btnTextColor, border: '0px'}} onClick={onClick}>{text === 'loading' ? <SyncOutlined spin/> : text}</Button>
  )
}
